import { Avatar } from "@mui/material";
import React from 'react'
import "./Post.css"

function Post() {
    return <div className='post'>
        <div className="post__header">
            <Avatar></Avatar>
        </div>
        <div className="post__image"></div>
        <div className="post__footer"></div>
    </div>;
}

export default Post
